from typing import List

class Solution:
    def minDominoRotations(self, A: List[int], B: List[int]) -> int:
        all_numbers = sorted(A + B)
        number_counter = {}
        for number in all_numbers:
            if number in number_counter:
                number_counter[number] += 1
            else:
                number_counter[number] = 1
        doable_numbers = [x for x, count in number_counter.items() if count >= len(A)]
        if not doable_numbers:
            return -1
        candidate = doable_numbers[0]
        print(candidate)

        moves_a = len([x for x in A if x != candidate])
        moves_b = len([x for x in B if x != candidate])
        num_moves_needed = min(moves_a, moves_b)
        print(num_moves_needed)

        moves = 0
        for i in range(len(A)):
            a = A[i]
            b = B[i]
            if moves_a <= moves_b:
                if a != candidate:
                    if b == candidate:
                        A[i], B[i] = B[i], A[i]
                        moves += 1
            else:
                if b != candidate:
                    if a == candidate:
                        A[i], B[i] = B[i], A[i]
                        moves += 1
            if moves >= num_moves_needed:
                return moves

        either_or = (len(set(A)) == 1) or (len(set(B)) == 1)
        if either_or:
            return moves
        return -1

